/*Table structure for table `assets` */

DROP TABLE IF EXISTS `assets`;

CREATE TABLE `assets` (
  `id` varchar(32) NOT NULL,
  `number` varchar(32) DEFAULT NULL COMMENT '编号',
  `company_id` varchar(32) DEFAULT NULL,
  `pid` varchar(32) DEFAULT NULL,
  `name` varchar(32) DEFAULT NULL COMMENT '名称',
  `elec_properties` int DEFAULT NULL COMMENT '是否电气属性 1是0否',
  `type` int DEFAULT NULL COMMENT '1.变压器2.进线3.馈线4.环网柜5.台变6.表计7.通讯管理机',
  `capacity` float DEFAULT NULL COMMENT '约定容量',
  `bill_type` int DEFAULT NULL COMMENT '计费类型 1.容量 2.需量',
  `bill_value` float DEFAULT NULL COMMENT '计费需量值/需量值',
  `bill_rule_id` varchar(32) DEFAULT NULL COMMENT '计费规则id',
  `pf_rule_id` varchar(32) DEFAULT NULL COMMENT '功率因素规则id',
  `create_at` timestamp NULL DEFAULT NULL,
  `update_at` timestamp NULL DEFAULT NULL,
  `logic` int DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='设备';

